import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('load');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find and click the "Your Profile" link.
    // Using getByRole is a robust way to select elements. We take the first one found.
    const profileLink = page.getByRole('link', { name: 'Your Profile' }).first();
    await profileLink.waitFor({ state: 'visible', timeout: 5000 });
    await profileLink.click();

    // Wait for the profile page content to be rendered by the script
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot after clicking the link
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract data to verify the action was successful
    const profileHeader = await page.locator('div.profile-header h2').textContent();
    const profileUsername = await page.locator('p.username').textContent();

    return {
      success: true,
      action: "Navigated to Jun's Profile page by clicking the 'Your Profile' link.",
      extractedData: {
        profileName: profileHeader,
        username: profileUsername
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to navigate to Jun's Profile",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
